void swap(int *fst, int *sec)
{
	int temp = *fst;
	*fst = *sec;
	*sec = temp;
}


void print_arr(int size, int *arr)
{
	printf("{");
	for (int i=0 ; i<size ; i++)
	{
		printf("%d", arr[i]);
		if (i < size-1)
			printf(", ");
	}
	printf("}\n");
}
